import { BrowserRouter, Route } from 'react-router-dom';
import Welcome from './components/Welcome';
import { Router } from 'react-router';

function App() {
  return (
    <Router>
      <Route path="/" component={Welcome} exact={true} />
    </Router>
  );
}

export default App;
